import React from  'react'
import { connect } from 'react-redux'

class Skills extends React.Component{

    render(){
        console.log(this.props)
        return(
            <div className="box">
                <p>Acrobatics (Dex)</p>
                <p>Animal Handling (Wis)</p>
                <p>Arcana (Int)</p>
                <p>Athletics (Str)</p>
                <p>Deception (Cha)</p>
                <p>History (Int)</p>
                <p>Insight (Wis)</p>
                <p>Intimidation (Cha</p>)
                <p>Investigation (Int)</p>
                <p>Medicine (Wis)</p>
                <p>Nature (Int)</p>
                <p>Perception (Wis)</p>
                <p>Performance (Cha)</p>
                <p>Persuasion (Cha)</p>
                <p>Religion (Int)</p>
                <p>Sleight of Hand (Dex)</p>
                <p>Stealth (Dex)</p>
                <p>Survival (Wis)</p>
            </div>
        )
    }

}


const mapStateToProps = (store) => {
    return {
      currentUser: store.currentUser,
      newCharClass: store.newCharClass,
      newCharRace: store.newCharRace,
      stats: store.stats,
      mods: store.mods
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
      LogIn: (loggedInUser) => {
        dispatch({ type: 'LOGIN_CURRENT_USER', user: loggedInUser })
      },
      AddRace: (charRace) => {
          dispatch({ type: 'ADD_Race', attribute: charRace })
      },
      AddStrength: (stat) => {
          dispatch({ type: 'ADD_strength', strength: stat})
      },
      AddDexterity: (stat) => {
          dispatch({ type: 'ADD_dexterity', dexterity: stat})
      },
      AddConstitution: (stat) => {
        dispatch({ type: 'ADD_constitution', constitution: stat})
      },
      AddIntelligence: (stat) => {
        dispatch({ type: 'ADD_intelligence', intelligence: stat})
      },
      AddWisdom: (stat) => {
        dispatch({ type: 'ADD_wisdom', wisdom: stat})
      },
      AddCharisma: (stat) => {
        dispatch({ type: 'ADD_charisma', charisma: stat})
      }
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Skills);
